  [],\n\t\"num_tags\": 0,\n\t\"name\": \"current-meter-data-from-moored-current-meter-casts-in-the-coastal-waters-of-se-alaska-brit-colu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Current meter data were collected using
  moored current meter casts in the Coastal Waters of SE Alaska/Brit.Colum. from March
  15, 1983 to November 1, 1983. Data were submitted by Pacific Marine Environmental
  Laboratory (PMEL) as part of the Long-Range Effects Program Puget Sound project.
  Data were processed by NODC to the NODC standard Current Meter Data (F015) format.
  Full current meter moorings descriptions are available at http://www.nodc.noaa.gov/General/NODC-Archive/f015.html.nnThe
  F015 format is used for time series measurements of ocean currents. These data are
  obtained from current meter moorings and represent Eulerian method of current measurement,
  i.e., the meters are deployed at a fixed point and measure flow past a sensor. Position,
  bottom depth, sensor depth, and meter characteristics are reported for each station.
  The data record comprises values of east-west (u) and north-south (v) current vector
  components at specified date and time. Current direction is defined as the direction
  toward which the water is flowing with positive directions east and north and negative
  directions west and south. Data values may be subject to averaging or filtering
  and are typically reported at 10-15 minute time intervals. Water temperature, pressure,
  and conductivity or salinity may also be reported. A text record is available for
  optional comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
